import React, { useState, useEffect } from "react";
import Navbar from "../Components/Navbar";
import { backendUrl } from "../exports";
import Match from "../Components/Match";

const Matches = () => {
  const [matchedUsers, setMatchedUsers] = useState([]);

  useEffect(() => {
    const fetchMatches = async () => {
      try {
        const response = await fetch(`${backendUrl}matching/getMatches?userId=${localStorage.getItem("userId")}`);
        const data = await response.json();
        setMatchedUsers(data.matches);
      } catch (error) {
        console.error("Error fetching matches:", error);
      }
    };

    fetchMatches();
  }, []);

  return (
    <>
      <Navbar />
      <div className="matches">
        <div className="matches-container">
          <h2>Matches</h2>
          <div className="matches-list">
            {matchedUsers.length > 0 ? (
              matchedUsers.map((match) => <Match key={match.id} match={match} />)
            ) : (
              <p>No matches found</p>
            )}
          </div>
        </div>
      </div>
    </>
  );
};

export default Matches;
